import React from 'react'
import './ContactPreview.scss'
import { Link } from 'react-router-dom'

export function ContactPreview(props) {
    const {name, _id} = props.pro
    return (
        <div className="contact-preview flex align-center">
            <Link className="flex align-center" to={`/contact/${_id}`}>
             <img width="50" height="50" src={`https://robohash.org/${name}?set=set5`} alt="img"></img>
             {name}
             </Link>
        </div>
    )
}
